import './Constructor.scss';

const Constructor = ({ rows }) => {


    const rowEls = () => {
        const rowEls = [];
        for (let i = 0; i < rows; i++) {
            rowEls.push((
                <div key={i} className="constructor-container__row-el">
                    <PlusCircleOutlined />
                    <div className="constructor-container__row-el__section"></div>
                </div>
            ))
        } 
        return rowEls;
    }

    return (
        <div className="constructor-container">
            {rowEls()}
        </div>
    );
}

export default Constructor;
